import React from 'react'
import transformDataToErrorPieChart from '../../../TransformDate/transformDataToErrorPieChart'
import ErrorPieChart from '../../charts/ErrorPieChart'

const StaticErrorPie = ({ data }) => {
  const transformedData = React.useMemo(
    () => transformDataToErrorPieChart(data),
    [data]
  )

  if (transformedData.length === 0) {
    return <p>No data found</p> // Mensagem quando não há dados
  }

  console.log('Vamos testar:', transformedData)
  return transformedData ? (
    <ErrorPieChart data={transformedData} />
  ) : (
    <p>No data found</p>
  )
}

export default StaticErrorPie
